namespace LeetCode
{
    public class _76_Minimum_Window_Substring
    {
        public static string MinWindow(string s, string t)
        {
            if (t.Length > s.Length) return "";

            if (t.Length == s.Length && s == t) return s;

            string result = "";

            for (int i = 0; i < s.Length; i++)
            {
                // STOP OUTER LOOP EARLY
                if (s.Length - i < t.Length)
                    break;

                string r = IsSubStringPossible(s, t, i, result.Length == 0 ? int.MaxValue : result.Length);

                if (r.Length == t.Length) return r;

                if (r != "")
                {
                    // keep minimum length window
                    if (result == "" || r.Length < result.Length)
                    {
                        result = r;
                    }
                }
            }

            return result;
        }

        public static string IsSubStringPossible(string s, string t, int startIndex, int currentMinLen)
        {
            int[] freq = new int[128];   // ASCII assumption
            int required = t.Length;

            // Build frequency
            foreach (char c in t)
                freq[c]++;

            int lastIndex = -1;

            for (int i = startIndex; i < s.Length; i++)   
            {
                // STOP INNER LOOP IF WINDOW ALREADY WORSE
                if (i - startIndex + 1 > currentMinLen)
                    break;

                if (freq[s[i]] > 0)
                {
                    required--;
                }

                freq[s[i]]--;

                if (required == 0)
                {
                    lastIndex = i;
                    break;
                }
            }

            if (lastIndex == -1)
                return "";

            return s.Substring(startIndex, lastIndex - startIndex + 1);
        }
    }
}

